        <h2 className='user-sidebar-logo'>개발 세발</h2>
      <button className="user-sidebar-close-button" onClick={toggleSidebar}>X</button>
      <ul className="user-navbar-list">
        <li><a>계정</a></li>
        <li><a>이력서</a></li>
        <li><a>포트폴리오</a></li>
      </ul>
    </div>
  );
}

export default UserNavbar;
